import React, { Component } from 'react';
import ScrollAnimation from 'react-animate-on-scroll';

export default class Describe extends Component {
    render() {
        return (
            <article className="Describe" id="Me">
                <ScrollAnimation animateIn="flipInY">
                    <p>Je m'appelle Christophe. Infographiste de par ma scolarité (et première passion), je me suis lancé dans une formation Web Developer depuis peu. Durant cette formation de 7 mois, j'ai appris plusieurs langages de programmation. </p>
                </ScrollAnimation>
                <p>Je m'appelle Christophe, j'ai 29 ans et je suis en fin de formation afin de devenir Web Developer Junior. Ayant toujours été intteressé par l'in</p>
            </article>
        );
    }
}
